				const html = updateImageReferences("<p>Trade makers representing buy or sell orders, are placed on the primary chart pane, above the individual price history intervals (candles) they are associated with via their timestamp.</p>\n<p><img alt=\"Trade Markers\" __ASTRO_IMAGE_=\"../../../assets/trade-markers.png\"></p>\n<p>TradeX Chart provides a number of marker icon options, their size and colour are configurable. <a href=\"#trades-settings\">Trades Settings</a> has more details.</p>\n<h2 id=\"toggling-trade-markers\">Toggling Trade Markers</h2>\n<h2 id=\"trade-order-data-entries\">Trade Order Data Entries</h2>\n<p>An individual trade entry has the following format:</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">const</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">trade</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">=</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  timestamp</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">1558605600000</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\"> </span><span style=\"color: #6B737C\">// number - time stamp</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  id</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"012336352\"</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">          </span><span style=\"color: #6B737C\">// string - trade id</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  side</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"buy\"</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">              </span><span style=\"color: #6B737C\">// string - buy or sell</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  price</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">7590</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">              </span><span style=\"color: #6B737C\">// number</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  amount</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">             </span><span style=\"color: #6B737C\">// number</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  filled</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">             </span><span style=\"color: #6B737C\">// number</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  average</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">7845</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">            </span><span style=\"color: #6B737C\">// number</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  total</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">1961</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\">              </span><span style=\"color: #6B737C\">// number</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  tag</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"Bot ABC - BTC/USDT\"</span><span style=\"color: #B392F0\"> </span><span style=\"color: #6B737C\">// string - user defined identifier</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>\n<h2 id=\"add-trade\">Add Trade</h2>\n<p>A single trade can be added to the chart data state via the following:</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #79B8FF\">chart</span><span style=\"color: #B392F0\">.addTrade(trade)</span></span></code></pre>\n<p>Where the <a href=\"#trade-entry\">trade entry object format</a> is defined in the previous section. <code>addTrade()</code> will validate the trade entry and return a boolean as the result.</p>\n<h2 id=\"remove-trade\">Remove Trade</h2>\n<p>Not implemented yet.</p>\n<h2 id=\"trade-state-data\">Trade State Data</h2>\n<p>The <a href=\"../state\">chart State Data</a> provides a collection of all of the trades that can be displayed on the chart.</p>\n<p>The trades are represented by an object in the <code>primary</code> chart pane of the data state.</p>\n<p>The trades object requires the following to be valid:</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<table><thead><tr><th>Property</th><th>Type</th><th>Description</th></tr></thead><tbody><tr><td>name</td><td>string</td><td>“Trades”</td></tr><tr><td>type</td><td>string</td><td>“trades”</td></tr><tr><td>settings</td><td>object</td><td><a href=\"#trades-settings\">define how trades are displayed</a></td></tr><tr><td>data</td><td>array</td><td><a href=\"#trade-data-trade-entries\">trade entries</a></td></tr></tbody></table>\n<h3 id=\"trades-settings\">Trades Settings</h3>\n<p>The default trade settings are as follows</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #B392F0\">{</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// icons must be in SVG format</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  iconBuy</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">tradeIcons</span><span style=\"color: #B392F0\">.arrowUp</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  iconSell</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">tradeIcons</span><span style=\"color: #B392F0\">.arrowDown</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  iconHeight</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">30</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  iconWidth</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">30</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  iconMinDim</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">10</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  buyColour</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#0f0\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  sellColour</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#f00\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  offset</span><span style=\"color: #BBBBBB\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">10</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>\n<p>Icons are expected to be in SVG format.</p>\n<h3 id=\"trades-data---trade-entries\">Trades Data - Trade Entries</h3>\n<p><a href=\"#trade-entry\">Trade entries (objects)</a> are grouped by timestamp in an array as it may be possible that multiple trades may be executed on the same time interval (candle).</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">const</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">config</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">=</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">ohlcv</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> []</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">primary</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> [</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    </span><span style=\"color: #FFAB70\">\"name\"</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"Trades\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    </span><span style=\"color: #FFAB70\">\"type\"</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"trades\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    </span><span style=\"color: #FFAB70\">\"settings\"</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// see above example for all options</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    data</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #F8F8F8\">1695906000000</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> [</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">          {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            timestamp</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">1695906000000</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            id</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"012336352\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            side</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"buy\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            price</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27032</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            amount</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            filled</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            average</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27032</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            total</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27032</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            tag</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"Bot ABC - BTC/USDT\"</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">          }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">        ]</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">        </span><span style=\"color: #F8F8F8\">1695945600000</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> [</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">          {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            timestamp</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">1695945600000</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            id</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"012335353\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            side</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"sell\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            price</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27032</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            amount</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            filled</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            average</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27032</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            total</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27032</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            tag</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"Bot ABC - BTC/USDT\"</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">          }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">        ]</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">        </span><span style=\"color: #F8F8F8\">1696327200000</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> [</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">          {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            timestamp</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">1696327200000</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            id</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"012335354\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            side</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"sell\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            price</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27550.6</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            amount</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            filled</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">0.25</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            average</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27550.6</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            total</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">27550.6</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">            tag</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"Bot ABC - BTC/USDT\"</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">          }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">        ]</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">]</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">secondary</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> []</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>\n<h2 id=\"trade-marker-event\">Trade Marker Event</h2>\n<p>By default, if a trade marker is clicked, it will invoke the trades overlay method which will display the trade data over the chart.</p>\n<p>This can be disabled via the <a href=\"../../02_configuration\">chart config</a>.</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">const</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">config</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">=</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  trades</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> { </span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    display</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">true</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    displayInfo</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span><span style=\"color: #B392F0\"> </span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>\n<p>The chart emits a <code>trade_selected</code> <a href=\"../../events\">event</a> which you can subscribe to and invoke your own method.</p>\n<p>The event will pass the information for that <a href=\"#trade-entry\">trade entry</a> to the subscribed event listener.</p>");

